import React from 'react';
import Login from './pages/Login';
import { Route, BrowserRouter, Switch } from 'react-router-dom';

export function Routes() {
  <BrowserRouter>
    <Switch>
      <Route exact path="/Login" component={Login} />
    </Switch>
  </BrowserRouter>
}
